(SELECT random_number_cte."KEY" AS "KEY", CASE WHEN (random_number_cte.uniform <= 0.208955223881) THEN 0 ELSE CASE WHEN (random_number_cte.uniform <= 0.522388059701) THEN 1 ELSE CASE WHEN (random_number_cte.uniform <= 0.776119402985) THEN 2 ELSE CASE WHEN (random_number_cte.uniform <= 1.0) THEN 3 END END END END AS multinomial_expr 
FROM random_number_cte), 
dummy_class_reg_cte AS 
(SELECT multinomial_cte."KEY" AS "KEY", 0.208955223881 AS "Proba_0", CASE WHEN (0.208955223881 IS NULL OR 0.208955223881 > 0.0) THEN ln(0.208955223881) ELSE -1.79769313486231e+308 END AS "LogProba_0", 0.313432835821 AS "Proba_1", CASE WHEN (0.313432835821 IS NULL OR 0.313432835821 > 0.0) THEN ln(0.313432835821) ELSE -1.79769313486231e+308 END AS "LogProba_1", 0.253731343284 AS "Proba_2", CASE WHEN (0.253731343284 IS NULL OR 0.253731343284 > 0.0) THEN ln(0.253731343284) ELSE -1.79769313486231e+308 END AS "LogProba_2", 0.223880597015 AS "Proba_3", CASE WHEN (0.223880597015 IS NULL OR 0.223880597015 > 0.0) THEN ln(0.223880597015) ELSE -1.79769313486231e+308 END AS "LogProba_3", multinomial_cte.multinomial_expr AS "Decision" 
FROM multinomial_cte)
 SELECT dummy_class_reg_cte."KEY" AS "KEY", CAST(NULL AS FLOAT(53)) AS "Score_0", CAST(NULL AS FLOAT(53)) AS "Score_1", CAST(NULL AS FLOAT(53)) AS "Score_2", CAST(NULL AS FLOAT(53)) AS "Score_3", dummy_class_reg_cte."Proba_0" AS "Proba_0", dummy_class_reg_cte."Proba_1" AS "Proba_1", dummy_class_reg_cte."Proba_2" AS "Proba_2", dummy_class_reg_cte."Proba_3" AS "Proba_3", dummy_class_reg_cte."LogProba_0" AS "LogProba_0", dummy_class_reg_cte."LogProba_1" AS "LogProba_1", dummy_class_reg_cte."LogProba_2" AS "LogProba_2", dummy_class_reg_cte."LogProba_3" AS "LogProba_3", dummy_class_reg_cte."Decision" AS "Decision" 
FROM dummy_class_reg_cte